import "./Table.css";
import Form from "../Form/Form";

export default function Table(props) {
  return (
    <div className="containerTable">
      <table>
        <tr>
          <th>{props.name}</th>
        </tr>

        <tr>
          <td>
            <Form type="text" input="table" place="Type Your Note No" />
          </td>
        </tr>
      </table>
    </div>
  );
}
